import React from "react";
import "../components/styles/L"

const LanguagePrediction = ({ predictionData }) => {
  return (
    <div className="language-prediction-container">
      <h2 className="prediction-title">언어 예측</h2>
      <div className="prediction-description">
        미래의 인기 언어를 예측하고 새로운 트렌드를 발견하세요.
      </div>
      <table className="prediction-table">
        <thead>
          <tr>
            <th>순위</th>
            <th>언어</th>
            <th>예측 점수</th>
            <th>성장률</th>
          </tr>
        </thead>
        <tbody>
          {predictionData.map((item, index) => (
            <tr key={index}>
              <td className="rank">{index + 1}</td>
              <td className="language">{item.language}</td>
              <td className="score">{item.predictionScore.toFixed(2)}</td>
              <td className={`growth-rate ${item.growthRate > 0 ? "positive" : "negative"}`}>
                {item.growthRate > 0 ? `+${item.growthRate.toFixed(2)}%` : `${item.growthRate.toFixed(2)}%`}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LanguagePrediction;
